package com.robin3;

import java.util.ArrayList;

public class WildCharMatching {
	char[] cs, ps;
	ArrayList<Integer> pos = new ArrayList<Integer>();
	ArrayList<Integer> left = new ArrayList<Integer>();
	int[][] dps;
	String as, ap;

	public boolean isMatch(String s, String p) {
		cs = s.toCharArray();
		ps = p.toCharArray();
		as = s;
		ap = p;
		pos.add(-1);
		int leftnum = 0;
		for (int i = 0; i < ps.length; i++) {
			if (ps[i] == '*') {
				pos.add(i);
				left.add(leftnum);
			} else
				leftnum++;
		}
		for (int i = 0; i < left.size(); i++) {
			left.set(i, ps.length - left.get(i) - pos.size() + 3);
		}
		left.add(ps.length);
		left.add(ps.length);

		pos.add(ps.length);
		dps = new int[pos.size() + 2][cs.length + 5];
		return dp(0, 0);
	}

	public boolean dp(int num, int scr) {
		System.out.println("dp" + num + "," + scr);
		if (num >= pos.size() - 1 || scr == cs.length) {
			if (num >= pos.size() - 1 && scr == cs.length)
				return true;
			return false;
		}
		if (dps[num][scr] != 0) {
			if (dps[num][scr] > 0)
				return true;
			else
				return false;
		}
		for (int i = scr; i < as.length() - left.get(num); i++) {
			boolean canMatch = match(pos.get(num), pos.get(num + 1), i, i + 1
					+ pos.get(num + 1) - pos.get(num));
			// System.out.println(canMatch);
			if (canMatch && dp(num + 1, i)) {
				dps[num][scr] = 1;
				System.out.println("setting dp" + num + "," + scr + "  true");
				return true;
			}
		}
		dps[num][scr] = -1;
		System.out.println("setting dp" + num + "," + scr + "  false");
		return false;
	}

	private boolean match(int pl1, int pl2, int sl1, int sl2) {
		if (pl2 - pl1 == 1)
			return true;
		if (sl2 > cs.length)
			return false;
		System.out.println("matching " + pl1 + "," + pl2 + "," + sl1);
		for (int i = pl1 + 1; i < pl2; i++) {
			int j = i - pl1 + sl1 - 1;
			if (j >= cs.length)
				return false;
			if (ps[i] != cs[j] && ps[i] != '?')
				return false;
		}
		return true;
	}

	public static void main(String[] args) {
		WildCharMatching wm = new WildCharMatching();
		// System.out.println(wm.isMatch("a", "a"));
		// System.out.println(wm.isMatch("", ""));
		// System.out.println(wm.isMatch("ab", "?*?"));
		System.out
				.println(wm
						.isMatch(
								"",
								"**"));
	}

}
